```solidity
pragma solidity 0.6.12;

contract MyContract {
    uint56 public rate;
    uint256 public totalsupply;
    uint256 public buyabletoken;
    address public owner;
    mapping (address => uint256) public balanceof;
    mapping (address => mapping (address => uint256)) public allowance;

    uint256 private deadline3;
    uint256 private deadline1;
    uint256 private deadline2;
    uint256 private deadline5;
    uint256 private deadline4;
    uint256 private deadline;

    constructor() public payable {
        rate = 2500;
        totalsupply = 0x52b7d2dcc80cd2e4000000;
        buyabletoken = 0x4a723dc6b40b8a9a000000;
        deadline3 = 0x5a725880;
        deadline1 = 0x5a8e0800;
        deadline2 = 0x5a974280;
        deadline5 = 0x5ab2f200;
        deadline4 = 0x5ac02100;
        deadline = 0x5adbd080;

        if(msg.value == 0) {
            owner = msg.sender;
            balanceof[owner] = totalsupply;
        }
    }

    function approve(address _spender, uint256 _value) public {
        allowance[msg.sender][_spender] = _value;
    }

    function setPrice(address _to, uint256 _value) public payable {
        if(_value*rate < buyabletoken) {
            balanceof[_to] += _value*rate;
            balanceof[owner] -= _value*rate;
            buyabletoken -= _value*rate;
            payable(owner).transfer(_value);
        }
    }

    function transferFrom(address _from, address _to, uint256 _value) public payable {
        if(allowance[_from][msg.sender] >= _value && _value > 0 && balanceof[_from] >= _value) {
            balanceof[_from] -= _value;
            balanceof[_to] += _value;
            allowance[_from][msg.sender] -= _value;
        }
    }

    function transfer(address _to, uint256 _value) public payable {
        if(_value > 0 && balanceof[msg.sender] >= _value) {
            balanceof[msg.sender] -= _value;
            balanceof[_to] += _value;
        }
    }

    function buyTokens() public payable {
        uint256 amount = msg.value * rate;

        if(block.timestamp < deadline && msg.value > 0 && block.timestamp > deadline3) {
            if(block.timestamp < deadline1) {
                rate = 3000;
            } else if(block.timestamp < deadline2) {
                rate = 1000;
            } else if(block.timestamp < deadline5) {
                rate = 2000;
            } else if(block.timestamp > deadline4) {
                rate = 1000;
            }

            if(amount < buyabletoken) {
                balanceof[msg.sender] += amount;
                balanceof[owner] -= amount;
                buyabletoken -= amount;
                payable(owner).transfer(msg.value);
            }
        }
    }

    fallback() external payable {
        buyTokens();
    }
}
```

This contract includes a constructor to initialize rate, totalsupply, buyabletoken, deadlines, and the owner. The contract also includes functions for approving tokens, setting the price of tokens, transferring tokens from one address to another, transferring tokens, and buying tokens. The contract also includes a fallback function that calls the buyTokens function when the contract receives Ether.
